window.onload = () => {
    const link = document.getElementById('link');
    let blob = new Blob(["<h1 className=\"text-center mb-4\">Список рекомендаций</h1>\n" +
    "\n" +
    "                    <p>По итогам теста Вами было набрано баллов: <i>{generateWeight()}</i>.</p>\n" +
    "\n" +
    "                    <p>Ниже будет приведен список рекомендаций, который поможет доработать ВКР до совершенства.\n" +
    "                        Каждый пункт списка содержит 1,5 условных балла и повышает вероятность более\n" +
    "                        профессионального восприятия Вашей работы дипломной Комиссией. Максимальное количество условных\n" +
    "                        баллов, которые можно было набрать по итогам теста: 50.</p>\n" +
    "\n" +
    "                    <h3 className=\"recommendations-title text-center\">Список рекомендаций</h3>\n" +
    "                    <p className=\"get-recommendation\">{generateRecommendations()}</p>"], {type: 'text/plain'});

    link.href = URL.createObjectURL(blob);
};
